import React from 'react'
import {useSelector} from 'react-redux'
import { Bar } from 'react-chartjsx'

const ChartData = () =>{ 

                const {DATA_TABLE_USER} = useSelector(state => ({...state.ChartReducer}))
                //wlanBytes : Dung Lượng
                const wlanBytes = []

                //numsta: Số Lượng
                const numsta = []

                //time: thời gian
                const time = []

            DATA_TABLE_USER.forEach(data => {
                wlanBytes.push(data.wlan_bytes)
                numsta.push(data.num_sta)
                time.push(data.time.toString('yyyy-MM-d-h-mm-ss'))
            });


            const mixedChartsData = {
                labels: time,
                datasets: [{ 
                    label: "Dung Lượng",
                    type: "line", 
                    borderColor: "#8e5ea2", 
                    data: wlanBytes, 
                    fill: false 
                }, { 
                    label: "Số Lượng", 
                    type: "bar", 
                    backgroundColor: "#FF5722", 
                    data: numsta, 
                }
                ] 
            }

    return (
        <div style={{marginTop: 100}}>
            <Bar data={mixedChartsData}
             width={600} 
             height={400} /> 
            </div>
    )
}

export default ChartData
